INSERT INTO metadata VALUES(1,'','Catalogue of the Pterophoroidea of the World','Pterophoroidea',replace('This GSD is derived from C. Gielis (2003) Pterophoroidea & Alucitoidea (Lepidoptera) (World Catalogue of Insects, volume 4). The database has been edited for inclusion in the Catalogue of Life and updated by Donald Hobern. A current version of the dataset is presented as a web document at https://pterophoroidea.hobern.net/. Version 1.1.24.215 includes updates to reflect recent changes in taxonomy and new species.\n','\n',char(10)),'2024-08-02','1.1.24.215 (02 Aug 2024)','','global','Pterophoroidea','All taxa described to present',5,99,'CC0','https://pterophoroidea.hobern.net','https://hobern.net/img/Deuterocopus_ritsemae.png','','',0);
