INSERT INTO name VALUES('2992','','','Hellinsia meyricki (Barnes & Lindsey, 1921)','Hellinsia meyricki','(Barnes & Lindsey, 1921)','SPECIES','','Hellinsia','','meyricki','','','',NULL,'','','','','','','','','','','ZOOLOGICAL','ESTABLISHED','1962','2023','172','','',NULL,'','','NOTE: Gielis (1993, 2003) treated meyricki as a synonym of H. fieldi. Matthews (2006) found these to be distinct species based on morphology of the genitalia, larvae, and pupae, as well as the use of different larval hostplants. It is formally reinstated herein (rev. stat.).','','');
INSERT INTO name VALUES('2993','','','Oidaematophorus poulini Bigot, 2021','Oidaematophorus poulini','Bigot, 2021','SPECIES','','Oidaematophorus','','poulini','','','',NULL,'','','','','','','','','','','ZOOLOGICAL','ESTABLISHED','1963','2021','142','','',NULL,'','','','','');
INSERT INTO name VALUES('2994','','','Hellinsia poulini (Bigot, 2021)','Hellinsia poulini','(Bigot, 2021)','SPECIES','','Hellinsia','','poulini','','','',NULL,'','','','','','','','','','','ZOOLOGICAL','ESTABLISHED','1962','2023','172','','',NULL,'','','NOTE: The name poulini (Bigot & Picard, 2005) is not available because the type repository was not indicated in the original publication. Bigot (2021) republished the description with the type repository included. The available name thus bears a different year and only one author. An image of the holotype genitalia (courtesy of Louis Handfield) is similar to the holotype of H. stramineus, and therefore poulini is transferred from Oidaematophorus to Hellinsia (n. comb.). Additional studies will determine whether or not H. poulini is indeed distinct from H. stramineus.','','');
INSERT INTO name VALUES('2995','','','Hellinsia angustus (Walsingham, 1880)','Hellinsia angustus','(Walsingham, 1880)','SPECIES','','Hellinsia','','angustus','','','',NULL,'','','','','','','','','','','ZOOLOGICAL','ESTABLISHED','1962','2023','172','','',NULL,'','','NOTE: Gielis (1993) synonymized both H. angustus and H. stramineus with H. pectodactylus. The Walsingham holotypes (NHMUK) represent two male genitalic forms which are herein raised back to species (rev. stat.). Given the variability seen in Palaearctic H. pectodactylus, more NA material should be examined to further assess variation between populations','','');
INSERT INTO name VALUES('2996','','','Hellinsia stramineus (Walsingham, 1880)','Hellinsia stramineus','(Walsingham, 1880)','SPECIES','','Hellinsia','','stramineus','','','',NULL,'','','','','','','','','','','ZOOLOGICAL','ESTABLISHED','1962','2023','172','','',NULL,'','','NOTE: Gielis (1993) synonymized both H. angustus and H. stramineus with H. pectodactylus. The Walsingham holotypes (NHMUK) represent two male genitalic forms which are herein raised back to species (rev. stat.). Given the variability seen in Palaearctic H. pectodactylus, more NA material should be examined to further assess variation between populations','','');
INSERT INTO name VALUES('2997','','','Hellinsia serenus (Meyrick, 1913)','Hellinsia serenus','(Meyrick, 1913)','SPECIES','','Hellinsia','','serenus','','','',NULL,'','','','','','','','','','','ZOOLOGICAL','ESTABLISHED','1962','2023','173','','',NULL,'','','NOTE: This species is herein reinstated as distinct from H. balanotes (rev. stat.) based on differences in wing maculation and male and female genitalia. Identified specimens are present in both the USNM and MGCL. Barnes & Lindsey (1921) illustrate an adult and male genitalia of a specimen that they indicate was identified by Meyrick via comparison with his type. Gielis (2003) synonymized H. serenus with H. balanotes without comment. Clarke (1955) lists H. serenus as a Meyrick type but did not indicate a repository. The current location of the type is unknown.','','');
